import styled from '@emotion/styled';

const Button = styled.button`
  width: 100%;
  padding: 15px;
  border-radius: 8px;
  border: none;
  font-size: 16px;
  font-weight: 500;
  cursor: pointer;
  
  &.primary {
    background-color: #6C5DD3;
    color: white;
  }
  
  &.secondary {
    background-color: #E8E6F9;
    color: #6C5DD3;
  }
`;

export default Button;
